    "comment" : "<p>A metadata annotation describing the types returned or yielded by a native element.</p> <p>The annotation is valid on a native method and a field of a native class.</p> <p>By default, a native method or field is seen as returning or yielding all subtypes if the method return type or field type.  This annotation allows a more precise set of types to be specified.</p> <p>See <code>Creates</code> for the syntax of the argument.</p> <p>Example: IndexedDB keys are numbers, strings and JavaScript Arrays of keys.</p> <pre><code>@Returns('String|num|JSExtendableArray') dynamic key;  // Equivalent: @Returns('String') @Returns('num') @Returns('JSExtendableArray') dynamic key; </code></pre>"
