  "Creates" : 
    "name" : "Creates"
    "qualifiedname" : "_js_helper.Creates"
    "comment" : "<p>A metadata annotation describing the types instantiated by a native element.</p> <p>The annotation is valid on a native method and a field of a native class.</p> <p>By default, a field of a native class is seen as an instantiation point for all native classes that are a subtype of the field's type, and a native method is seen as an instantiation point fo all native classes that are a subtype of the method's return type, or the argument types of the declared type of the method's callback parameter.</p> <p>An @<code>Creates</code> annotation overrides the default set of instantiated types.  If one or more @<code>Creates</code> annotations are present, the type of the native element is ignored, and the union of @<code>Creates</code> annotations is used instead. The names in the strings are resolved and the program will fail to compile with dart2js if they do not name types.</p> <p>The argument to <code>Creates</code> is a string.  The string is parsed as the names of one or more types, separated by vertical bars <code>|</code>.  There are some special names:</p><ul><li> <p><code>=Object</code>. This means 'exactly Object', which is a plain JavaScript object   with properties and none of the subtypes of Object.</p></li></ul> <p>Example: we may know that a method always returns a specific implementation:</p> <pre><code>@Creates('_NodeList') List&lt;Node&gt; getElementsByTagName(String tag) native; </code></pre> <p>Useful trick: A method can be marked as not instantiating any native classes with the annotation <code>@Creates('Null')</code>.  This is useful for fields on native classes that are used only in Dart code.</p> <pre><code>@Creates('Null') var _cachedFoo; </code></pre>"
    "superclass" : "dart.core.Object"
    "abstract" : "false"
    "typedef" : "false"
